import logo from '../assets/photo.jpg';
import logo1 from '../assets/photo.jpg';
import logo2 from '../assets/photo.jpg';
import logo3 from '../assets/photo.jpg';
import logo4 from '../assets/photo.jpg';
import logo5 from '../assets/photo.jpg';
import logo6 from '../assets/photo.jpg';
import logo7 from '../assets/photo.jpg';
import logo8 from '../assets/photo.jpg';
import logo9 from '../assets/photo.jpg';
import logo10 from '../assets/photo.jpg';


//import '../components/GallerData.css';
const GalleryData = () => {
    return ( 
        <>
            
<h1>Innobuzz Gallery</h1>
        <div className="gallery">
            
            <div>
            <img src={logo} alt="Logo" className="navy" />
            </div>
            <div>
            <img src={logo1} alt="Logo" className="navy" />
            </div>
            <div>
            <img src={logo2} alt="Logo" className="navy" />
            </div>
            <div>
            <img src={logo3} alt="Logo" className="navy" />
            </div>
            <div>
            <img src={logo4} alt="Logo" className="navy" />
                </div>
                <div>
            <img src={logo5} alt="Logo" className="navy" />
                </div>
                <div>
            <img src={logo6} alt="Logo" className="navy" />
                </div>
                <div>
            <img src={logo7} alt="Logo" className="navy" />
                </div>
                <div>
            <img src={logo8} alt="Logo" className="navy" />
                </div>
                <div>
            <img src={logo9} alt="Logo" className="navy" />
                </div>
                <div>
            <img src={logo10} alt="Logo" className="navy" />
            </div>
        </div>
</>
     );
}
 
export default GalleryData;
